import React from 'react';
import { StyleSheet} from 'react-native';

export const styles = StyleSheet.create({
  buttonContainer: {
    width: '280px',
    height: '40px',
    alignSelf: 'center',
    marginVertical: 30,
  },
  logo: {
    width: '220px',
    height: '70px',
    fontSize: 20,
    fontWeight: "600",
    textAlign: 'center',
    color: '#68b0ab',
    lineHeight: 35,
  },
  onsiteText: {
    color: white,
  },
  container: {
    backgroundColor: white,
    marginTop: 20,
    flex: 1,
    alignItems:center,
  },
  consumerWrapper: {
    backgroundColor: '#8FD7D3',
    padding:10,
    width:280,
    marginTop:60,
    height:45,
    alignItems: 'center',
    borderRadius:25,
  },
  providerWrapper: {
    backgroundColor: '#FDB0A8',
    padding:10,
    width:280,
    marginTop:30,
    height:45,
    alignItems: 'center',
    borderRadius:25,
  },
  img2: {
    marginTop:70,
    width:120,
    height:32,
  },
  img: {
    marginTop:30,
    width:380,
    height:500,
  },
});
